(1, 'Macbook Pro', '2020-05-18 02:17:21', 28000000, 30000000, 80, 'hitam', 'Touch Bar dengan sensor Touch ID terintegrasi.Layar 13,3 inci (diagonal) dengan lampu latar LED dan teknologi IPS; resolusi 2560 x 1600 pada 227 piksel per inci dengan dukungan untuk jutaan warna.Skala resolusi yang didukung:\n            1680 x 1050\n\n            1440 x 900\n\n            1024 x 640\n\n            Kecerahan 500 nit\n\n            Warna luas (P3)\n\n            Teknologi True Tone.Intel Core i5 quad-core 1,4 GHz, Turbo Boost hingga 3,9 GHz, dengan eDRAM sebesar 128 MB.SSD 128 GB.Memori terpasang LPDDR3 2133 MHz sebesar 8 GB.', '/assets/produk/macbook.jpg', 1, NULL, NULL),
(2, 'Lenovo Y530', '2020-05-18 02:17:21', 9000000, 10000000, 90, 'hitam', 'Lenovo Legion Y530 Gaming\n\n                - Processor : 8th Generation Intel® Core™ i7-8750H Processor 4.50 GHz with Turbo Boost\n                - Memory : 16 GB DDR4 2666 MHz Super Speed Up To 32 GB\n                - Graphic : NVIDIA® GeForce® GTX 1050 ti 4 GB GDDR5X DEDICATED VRAM\n                - Storage : 256 GB M.2 SSD + 1 TB HDD + FireCuda 8 GB Cache\n                - Display : 15.6” FHD IPS Anti-Glare 72% color gamut 300 nits\n                - Connectivity : 3 x USB 3.1, Mini DisplayPort™ 1.4, HDMI™ 2.0, 1 x USB 3.1 Gen 2 Type-C / Intel Thunderbolt 3, Bluetooth 4.2, Gigabyte Ethernet Mps, RJ45 Ethernet, Kensington Wedge Lock Out, NOVO hole\n                - Audio : Harman® speakers with Dolby Atmos® for Gaming\n                OS : Windows 10 Original.', '/assets/produk/lenovo2a.jpg', 1, NULL, '2020-05-17 19:38:04'),
(3, 'ASUS ExpertBook', '2020-05-18 02:17:21', 12000000, 13000000, 3, 'hitam', 'Processor : Intel Core i7 8565U Processor\n                RAM : 8GB DDR4 Memory\n                Storage : 1TB SATA HDD\n                Graphics : Nvidia Geforce MX110 2GB VRAM\n                Display : 14 Inch LED backlit HD (1366x768)\n                OS : Windows 10 Home Original.', '/assets/produk/asus1a.jpg', 1, NULL, NULL),
