(12, 'Redmi Note 8 Pro', '2020-05-20 00:00:00', 2990000, 3100000, 10, 'Hijau', 'Spesifikasi Xiaomi Redmi Note 8 Pro :\r\n- Dimensi Body : 161.3 x 76.4 x 8.8 mm (6.35 x 3.01 x 0.35 in)\r\n- Tipe Layar : IPS LCD capacitive touchscreen, 16M colors\r\n- Ukuran Layar : 6.53 inches\r\n- Resolusi : 1080 x 2340 pixels, 19.5:9 ratio (~395 ppi density)\r\n- Berat : 199 g\r\n- Material : Front/back glass (Gorilla Glass 5)\r\n- Memori Internal : 128 GB\r\n- Eksternal : microSD, up to 256 GB (uses shared SIM slot)\r\n- Ram : 6 GB\r\n- OS : Android 9.0 (Pie); MIUI 10\r\n- Chipset : Mediatek Helio G90T (12nm)\r\n- CPU : Octa-core (2x Cortex-A76 & 6x Cortex-A55)\r\n- GPU : Mali-G76MC4\r\n- Sim Card : Hybrid Dual SIM (Nano-SIM, dual stand-by)\r\n- Internet : HSPA / LTE\r\n- GPS : A-GPS, GLONASS, BDS\r\n- Bluetooth : 5.0, A2DP, LE\r\n- Wifi : Wi-Fi 802.11 a/b/g/n/ac, dual-band, Wi-Fi Direct, hotspot\r\n- USB : 2.0, Type-C 1.0 reversible connector\r\n- Kamera Belakang : QUAD\r\n64 MP, f/1.8, (wide), 1/1.7\", 0.8m, PDAF\r\n8 MP, f/2.2, 13mm (ultrawide), 1/4\", 1.12m\r\n2 MP, f/2.4, 1/5\", 1.75m (dedicated macro camera)\r\n2 MP, f/2.4, 1/5\", 1.75m, depth sensor\r\nFitur : Dual-LED flash, HDR, panorama\r\nVideo : 2160p@30fps, 1080p@30/60/120fps, (gyro-EIS)\r\n- Kamera Depan : 20 MP, f/2.0\r\nVideo : 1080p@30fps\r\n- Baterai : Non-removable Li-Po 4500 mAh battery\r\n- Varian Warna : grey,green,white\r\n- Fitur :\r\nSensor Fingerprint (rear-mounted), accelerometer, gyro, proximity, compass\r\nFast battery charging 18W (Quick Charge 4+)', '/assets/produk/8pro.png', 2, '2020-05-17 19:24:53', '2020-05-17 19:24:53');
